60ハリアー用　フロントドアスピーカー取付セット<br>
FOCAL（フォーカル）スピーカー<br><br>
■セット内容<br>
・FOCALスピーカー左右1セット<br>
・ツイーター取付ステー　2個<br>
・配線<br>
・メーカー保証書<br>
・取扱説明書　etc...<br><br>

■適合情報<br>
車種：トヨタ　アルファード/ヴェルファイア<br>
型式：30系<br>
年式：H27.01～
<br><br>
 【ご注意】<br>
こちらの商品はメーカーより取り寄せ商品となります。<br>
在庫がある場合は即日発送可能ですが、在庫がない場合は納期2週間～3週間いただく場合がございます。<br>
お急ぎの方は事前にお問い合わせ下さい。<br>







